Помнишь историю с расплавленным коннектором у GeForce RTX 4090 из-за нагрузки в играх? Она не закончилась. 

➖Жалоб на расплавленные коннекторы всё больше; 
➖Покупка БП с 12VHPWR-коннектором не спасает; 
➖Лидеры по расплавке – видеокарты от ASUS и MSI; 
➖Коннектор плавится даже если пользователь подключил всё на 100% правильно – провод без изгибов, коннектор вставлен до конца и т.д.; 
➖Предположения о проблеме из-за использования проводов 150V вместо 300V не нашли подтверждений; 
➖Не спасает даже покупка RTX 4090 Founders Edition от NVIDIA. Плавится и эта видеокарта; 
➖NVIDIA хранит молчание и просто меняет карты с расплавленным коннектором по гарантии.
